apiVersion: v1
kind: Service
metadata:
  name: lwfw
spec:
  ports:
  - port: 5680
    protocol: TCP
    targetPort: 5680
  selector:
    app: lwfw
  type: ClusterIP
---
apiVersion: v1
kind: Service
metadata:
  name: lwfw-portal-soap
spec:
  ports:
  - name: http
    port: 5580
    protocol: TCP
    targetPort: http
  selector:
    app.kubernetes.io/component: asi-server
  type: ClusterIP
---
apiVersion: v1
kind: PersistentVolumeClaim
metadata:
  name: lwfw-files
spec:
  accessModes:
  - ReadWriteOnce
  resources:
    requests:
      storage: 1Gi
  storageClassName: managed-nfs-storage
  volumeMode: Filesystems
---
apiVersion: apps/v1
kind: StatefulSet
metadata:
  name: lwfw
spec:
  replicas: 1
  selector:
    matchLabels:
      app: lwfw
  serviceName: lwfw
  template:
    metadata:
      labels:
        app: lwfw
    spec:
      containers:
      - image: image-registry.openshift-image-registry.svc:5000/tools/lightwell-portal:v2.12.2
        name: lwfw
        ports:
        - containerPort: 5680
          name: lwfw
          protocol: TCP
        securityContext:
          runAsUser: 0
        volumeMounts:
        - mountPath: /app/config
          name: lw-app-prop
        - mountPath: /files
          name: lw-data
      volumes:
      - name: lw-app-prop
        projected:
          sources:
          - secret:
              name: lw-app-prop
          - configMap:
              items:
              - key: LwEncryption.jar
                path: LwEncryption.jar
              name: lw-enc-jar
      - name: lw-data
        persistentVolumeClaim:
          claimName: lwfw-files
---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  creationTimestamp: null
  name: lw-app-prop
  namespace: tools
spec:
  encryptedData:
    application.properties: 
    customer_LW_license.properties: 
    encryption.key: 
    portal.key: 
  template:
    metadata:
      creationTimestamp: null
      name: lw-app-prop
      namespace: tools
---
apiVersion: route.openshift.io/v1
kind: Route
metadata:
  name: lwfw
spec:
  port:
    targetPort: 5680
  to:
    kind: Service
    name: lwfw
    weight: 100
  wildcardPolicy: None
---
apiVersion: route.openshift.io/v1
kind: Route
metadata:
  name: lwfw-portal-soap
spec:
  path: /portal_soap
  port:
    targetPort: http
  to:
    kind: Service
    name: lwfw-portal-soap
    weight: 100
  wildcardPolicy: None
